(function(){$.widget("execut.MassDeleteForm",{_progressBarEl:null,_submitButtons:null,_create:function(){var b=this;b._initElements();b._initEvents()},_initElements:function(){var d=this,c=d.element;d._progressBarEl=c.find(".progress-bar");d._errorsEl=c.find(".delete-errors");if(d._progressBarEl.length){d._updateProgressBar()}},_initEvents:function(){var d=this,c=d.element},_updateProgressBar:function(){var b=this;$.get(location.href+"&getProgress=1",function(a){if(a.progress===100){location.href=location.href}else{b._errorsEl.html(a.errors);b._progressBarEl.css("width",a.progress+"%");setTimeout(function(){b._updateProgressBar()},1000)}})}})})();